.
Imagínate esto: 15 días alejados de la civilización 🌏 cero Internet, cero señal del celular, sin agua potable y durmiendo en la mitad de una playa 💥 en una pequeña cabaña de madera 💭 con una familia de la zona 💥 y cientos de animales y bichos a nuestro alrededor 😋
.
Suena incómodo, ¿cierto? 💭 Definitivamente cero lujos, pero puedo decirles que este viaje cambió mi manera de ver la vida 🙏
.
Fue así como entendí que dependemos de muchas cosas materiales que NI NECESITAMOS ♥️ Fue así como entendí que solo bastaba con una buena compañía para gozar mis días sin importar donde estuviera ♥️ y quedarnos filosofando hasta las 3am con una velita que nos alumbraba 🙏
.
Fue así como entendí que con sólo un traje de baño 😳 el mar 🌊 tortugas 🐢 ballenas 🐳 cascadas 💦 pescadito frito, arroz con coco 🥥 y la sencillez y calidez de mi familia adoptiva, podía sentirme completamente plena ♥️ fue ahí cuando entendí lo hermoso que era desconectarme de todos estos aparatos y de tanta información y simplemente vivir el ahora 💥 y disfrutar de los regalos de la naturaleza 🙏
.
La vida de viajera me demostró que más allá de lujos y posesiones 💭 quería una vida llena de calma, amigos, conexión y sencillez ♥️ por eso hoy y siempre, elijo una vida LLENA DE PAZ Y AMOR POR LOS PEQUEÑOS (PERO ENORMES) REGALOS DEL UNIVERSO 🌌
.
